                                    "title": "（个人闲置）省队专用 双鱼七星乒乓球拍麒麟风系列专业级比赛单 拍双对拍初学者乒乓球直拍横拍比赛训练对拍\n\n仓库搬迁，低价处理一批7星乒乓球拍，回购率超高的 ，现在低价处理，看上直接拍，目前横拍/直拍均有现货，卖完下架，先到先得！！\n\n材质性能：7星球拍采用7层纯木底板，胶皮为高弹性双面反胶，粘性很强，轻松击出旋转的回球。且弹性十足，用的高密蓝海绵，特别针对控制球为主或乏力较小的选手而言之，可减少发力时的沉重感，并获得较长的弧线，有利于对球的控制！\n配置：横拍重量185克左右，直拍重量175克左右，厚度约1.5cm。拿起来比较有舒适感，比较适合弧圈，攻防全面型选手，同时，球拍自身力量能够提供良好的出球速度，好处不过多说，用过的人才有资格去评价！\n\n单只20元  送1包3三星球\n一对35元  送1包10三星球\n\n\n横拍直拍均有现货\n\n新旧程度：全新微瑕 介意者慎拍\n\n收到不满意可在驿站验货拒收，不试用哈！"
